import React,{Component} from 'react';

class Homebody extends Component{
    render(){
        return(
            <div class="hompagebody">
                <div className="bodypage">
                        <h3>Welcome To
                            <span> Medi</span></h3>
                        <p>This is a project that will help any patient to monitor health situation and also can find any appoinment of any registered doctor within a very short time.</p>
                        <h4>The service we provide:-</h4>
                        <ul>
                            <li><img src="/pin.png" />Online Health Monitoring</li>
                            <li><img src="/pin.png" />Apply for doctor appoinment</li>
                            <li><img src="/pin.png" />See Available doctor </li>
                            <li><img src="/pin.png" />See available medicine</li>
                            <li><img src="/pin.png" />Any Medical test report result.</li>
                        </ul>
                </div>
            </div>
        );
    }
}

export default Homebody;
